import React from "react";

function Manager() {
  return (
    <div className="sidebar">
      <ul>
        <li>Home</li>
        <li>Services</li>
        <li>Options</li>
        <li>About Us</li>
        <li>Contact Us</li>
      </ul>
    </div>
  );
}

export default Manager;
